 , and not by other apoptotic stimuli , including nuclear factor ( NF ) - kappaB with its target genes IEX - 3 ,

 ,

 , and

 . We demonstrate that suppression of NF-kappaB activation markedly enhances SERM-induced apoptosis , suggesting a role for NF-kappaB in protecting glioma cells from SERM-induced cytotoxicity . These findings demonstrate for the first time that a SERM other than tamoxifen can induce glioma cell apoptosis in vitro and in vivo and that the clinical efficacy of SERMs for the treatment of malignant gliomas could potentially be enhanced by simultaneous inhibition of the NF-kappaB pathway .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Vanadate induction of NF-kappaB involves

 beta and

 and enhanced NF-kappaB activity in cells exposed to vanadate . To determine whether the IKK pathway and JNK pathway are interconnected or bifurcate upon vanadate stimulation , cells were transfected with either a kinase inactive form of IKKbeta or a kinase inactive form of

<div class="entities" style="line-height: 2.5; direction: ltr">Nuclear factor-kappaB enhances ErbB 2 - induced mammary tumorigenesis and neoangiogenesis in vivo . The ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 / Neu ) ErbB 2 oncogene is commonly overexpressed in human breast cancer and is sufficient for mammary tumorigenesis in transgenic mice . Nuclear factor ( NF ) - kappaB activity is increased in both human and murine breast tumors . The immune response to mammary tumorigenesis may regulate tumor progression . The role of endogenous mammary epithelial cell NF-kappaB had not previously been determined in immune-competent animals . Furthermore , the role of the NF-kappaB components , p50 and p65 , in tumor growth was not known . Herein , the expression of a stabilized form of the NF-kappaB-inhibiting 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 protein ( IkappaBalphaSR ) in breast tumor cell lines that express oncogenic ErbB 2 inhibited DNA synthesis and growth in both two - and three-dimensional cultures . Either NF-kappaB inhibition or selective silencing of p50 or p65 led to a loss of contact-independent tumor growth in vitro . IkappaBalphaSR reversed the features of the oncogene-induced phenotype under three-dimensional growth conditions . The NF-kappaB blockade inhibited ErbB 2 - induced mammary tumor growth in both immune-competent and immune-deficient mice . These findings were associated with both reduced tumor microvascular density and a reduction in the amount of vascular endothelial growth factor . The expression of IkappaBalphaSR in breast cancer tumors inhibited angiogenesis . Thus , mammary epithelial cell NF-kappaB activity enhances ErbB 2 - mediated mammary tumorigenesis in vivo by promoting both growth and survival signaling via the promotion of tumor vasculogenesis .</div>
